import React, { useState } from "react";
import { useForm, FormProvider } from "react-hook-form";
import { Input } from "../../components/input";

const Step1 = ({ nextStep }: { nextStep: () => void }) => {
  const { control } = useForm();

  return (
    <div>
      <h2>Digite suas informações</h2>
      <label>Nome:</label>
      <Input
        name="nome-completo"
        control={control}
        type="text"
        placeholder="Nome Sobrenome"
        isRequired={true}
      />

      <label>Data de Nascimento:</label>
      <Input
        name="data-nascimento"
        control={control}
        type="date"
        placeholder=""
        isRequired={true}
      />

      <label>CPF:</label>
      <Input
        name="cpf"
        control={control}
        type="text"
        placeholder="999.999.999-99"
        isRequired={true}
      />

      <label>Telefone:</label>
      <Input
        name="telefone"
        control={control}
        type="text"
        placeholder="(99) 99999-9999"
        isRequired={true}
      />

      <button type="button" onClick={nextStep}>Próximo</button>
    </div>
  );
};

const Step2 = ({ prevStep, nextStep }: { prevStep: () => void; nextStep: () => void }) => (
  <div>
    <h2>Endereço</h2>
    <label>Rua:</label>
    <input type="text" placeholder="Digite sua rua" />
    <br />
    <label>Cidade:</label>
    <input type="text" placeholder="Digite sua cidade" />
    <br />
    <label>Estado:</label>
    <input type="text" placeholder="Digite seu estado" />
    <br />
    <button type="button" onClick={prevStep}>Voltar</button>
    <button type="button" onClick={nextStep}>Próximo</button>
  </div>
);

const Step3 = ({ prevStep }: { prevStep: () => void }) => (
  <div>
    <h2>Confirmação</h2>
    <p>Revise suas informações antes de enviar!</p>
    <button type="button" onClick={prevStep}>Voltar</button>
    <button type="submit">Enviar</button>
  </div>
);

const Cadastrar = () => {
  const methods = useForm(); // Inicialização do react-hook-form
  const { handleSubmit } = methods; // Para capturar o evento de submit

  const [step, setStep] = useState(1);

  const nextStep = () => setStep((prev) => prev + 1);
  const prevStep = () => setStep((prev) => prev - 1);

  const onSubmit = (data: any) => {
    console.log("Formulário submetido:", data);
    // Aqui você pode enviar os dados para o backend
  };

  return (
    <FormProvider {...methods}>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div>
          <h1>CondoFácil</h1>
          {step === 1 && <Step1 nextStep={nextStep} />}
          {step === 2 && <Step2 nextStep={nextStep} prevStep={prevStep} />}
          {step === 3 && <Step3 prevStep={prevStep} />}
          <div>
            <p>Passo {step} de 3</p>
          </div>
        </div>
      </form>
    </FormProvider>
  );
};

export { Cadastrar };
